	BEGIN
		SET IDENTITY_INSERT [dbo].[tmp_ms_xx_StaffCredential] ON;
		INSERT INTO [dbo].[tmp_ms_xx_StaffCredential] ([StaffCredentialId], [PersonCredentialId], [TechnologySkillsStandardsMet], [DiplomaOrCredentialAwardDate], [CTEInstructorIndustryCertification], [CardiopulmonaryResuscitationCertification], [FirstAidCertification], [DataCollectionId], [RefTeachingCredentialTypeId], [RefTeachingCredentialBasisId], [RefChildDevAssociateTypeId], [RefParaprofessionalQualificationId], [RefProgramSponsorTypeId], [RecordStartDateTime], [RecordEndDateTime], [RefAeCertificationTypeId])
		SELECT   
				 [StaffCredential].[StaffCredentialId],
				 [StaffCredential].[PersonCredentialId],
				 [StaffCredential].[TechnologySkillsStandardsMet],
				 [StaffCredential].[DiplomaOrCredentialAwardDate],
				 [StaffCredential].[CTEInstructorIndustryCertification],
				 [StaffCredential].[CardiopulmonaryResuscitationCertification],
				 [StaffCredential].[FirstAidCertification],
				 [StaffCredential].[DataCollectionId],
