				 [StaffCredential].[RefProgramSponsorTypeId],
				 [StaffCredential].[RecordStartDateTime],
				 [StaffCredential].[RecordEndDateTime],
				 [AeStaff].[RefAeCertificationTypeId]
		FROM     [dbo].[StaffCredential]
			LEFT OUTER JOIN [dbo].[PersonCredential] ON [PersonCredential].[PersonCredentialId] = [StaffCredential].[PersonCredentialId]  
			LEFT OUTER JOIN [dbo].[OrganizationPersonRole] ON [OrganizationPersonRole].[PersonId] = [PersonCredential].[PersonId]
			LEFT OUTER JOIN [dbo].[AeStaff] ON [AeStaff].[OrganizationPersonRoleId] = [OrganizationPersonRole].[OrganizationPersonRoleId] 
		ORDER BY [StaffCredentialId] ASC;
		SET IDENTITY_INSERT [dbo].[tmp_ms_xx_StaffCredential] OFF;
	END

